import './App.css';
import Navbar from './components/Navbar'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import {ScrollConatainer, ScrollPage, Animator, batch, Sticky, Fade, MoveOut} from 'react-scroll-motion'

function App() {
  return (
    <ScrollConatainer>

      {/* <ScrollPage page={0}>
        <Animator animation={batch(Sticky(), Fade(), MoveOut(0, -200))}>
          <h2>Scroll animation 1</h2>
        </Animator>
      </ScrollPage> */}

      <Router>
        <Navbar /> 
        <Routes>
          <Route path="/" />
          <Route path="/products" />
          <Route path="/contact" />
          <Route path="/about" />
        </Routes>
      </Router>
    </ScrollConatainer>
  );
}

export default App;
